import { UserContext } from "../UserContext"
import { useContext } from "react"

export default function AccountPage(){
    const {ready,user}=useContext(UserContext);
    if(ready && !user){
        return <Navigate to={'/login'}/>
    }
    return(
        <div>Account Page</div>
    )
}
